import React, { useState, useEffect } from 'react';

const PropertyListing = ({ image_url, title, description, city, state, zip_code, price }) => (
  <div>
    </div>
);

const ListingPage = ({ list }) => {
  console.log(list);
  if (!Array.isArray(list) || list.length === 0) {
    return (
      <div>
        <h1>No Property Listings Found</h1>
      </div>
    );
  }

  const rental = list.map((rentals) => (
    <PropertyListing key={rentals.id} {...rentals} />
  ));

  return (
    <div>
      <h1>Property Listings</h1>
      <ul>{rental}</ul>
    </div>
  );
};

const Listings = () => {
  const [listings, setListings] = useState([]);

  useEffect(() => {
    fetch('http://127.0.0.1:5000/listings')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setListings(data);
      })
      .catch((error) => {
        console.error('Error fetching property listings:', error);
      });
  }, []);
  return (
    <div>
      <h1>LISTINGS</h1>
      <div>

        {listings.map((listing) => (
          <div key={listing.id} className="rental-listing">
            <img src={listing.image_url} alt="rental property" />
            <h2>{listing.title}</h2>
            <p>Description: {listing.description}</p>
            <p>City: {listing.city}</p>
            <p>State: {listing.state}</p>
            <p>Zip Code: {listing.zip_code}</p>
            <p>Price: {listing.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Listings;
